import React, { Component } from "react";
import Product from "./Product";
import Title from './Title';
export default class ProductList extends Component {
  state={
    products:{}
  }
  render() {
    return (
      <React.Fragment>
      <div className="py-5">
      <div className="container">
      <Title name="Gumbo's" title="Merchandise" />
      <div className="row" />
      </div>
      </div>
        //<Product/>
      </React.Fragment>
    );
  }
}
